var OneApp={callbacks:{}};

OneApp.getValue=function(keys,callback){
	var params={};
	params.callback= "oneApp"+Math.floor(Math.random()*10000000);
	$.each(keys,function(key,value){
		params[value]='';
	});
	OneApp.callbacks[params.callback]=callback;
	command("getValues",params);
	//con
}

OneApp.alert = function(data,template){
	prepareTemplate(data,template).then(function(html){
		var popup=$("<div class='popup'>"+html+"</div>");
		$("body").append(popup);
		popup.fadeIn();
	});
}

var platform="material";
// var apiBaseUrl="http://192.168.100.5:8000/api";
