function displayList($data, $to, $template_name){
	
	$template_name=$template_name||"default";
	var $template="listview/"+$template_name;
	renderTemplate($data,$to,$template)
}


function renderTemplate($data,$to,$template,$callback){

	prepareTemplate($data,$template,function(html){
		$($to).html(html);
		if($callback)
			$callback();
	});
}

function prepareTemplate($data,$template,$callback){
	
		var template_path=ROOT_DIR+"templates/"+$template+".mustache";
		$.get(template_path,function(resp){
		var $template=Mustache.render(resp,$data);
		$callback($template)
	});
	
}


function xml2json(xml) {
  try {
    var obj = {};
    if (xml.children.length > 0) {
      for (var i = 0; i < xml.children.length; i++) {
        var item = xml.children.item(i);
        var nodeName = item.nodeName;

        if (typeof (obj[nodeName]) == "undefined") {
          obj[nodeName] = xml2json(item);
        } else {
          if (typeof (obj[nodeName].push) == "undefined") {
            var old = obj[nodeName];

            obj[nodeName] = [];
            obj[nodeName].push(old);
          }
          obj[nodeName].push(xml2json(item));
        }
      }
    } else {
      obj = xml.textContent;
    }
    return obj;
  } catch (e) {
      console.log(e.message);
  }
}

function command(action,options){
	var url="oneapp://"+action;

	if(options){
		if(url.indexOf("?")>=0)
			url+="&"
		else
			url+="?"
		var params=[];	
		$.each(options,function(key,value){
			params.push(key+"="+encodeURIComponent(value));
		});
		url+=params.join("&");
	}
	requestURL(url);
}

function requestURL(url){
	var iframe = document.createElement("IFRAME");
    iframe.setAttribute("src", url);
    document.documentElement.appendChild(iframe);  // Execution NOT blocking here either :(
    iframe.parentNode.removeChild(iframe);
    iframe = null;
}

function facebookLogin(token){
	OneApp.getValue(['fcm_token'],function(resp){
			var fcm_token=resp.fcm_token||"";
			$.ajax({
				url:apiBaseUrl+"/login",
				method:"GET",
				data:{fb_token:token,fcm_token:fcm_token},
				dataType:"json",
				success:function(resp){
					command("saveValues?access_token="+resp.access_token+"&refresh_token="+resp.refresh_token);
					// if(!isDashboard)
					// 	command("userLoginStatusChanged");
					if(typeof onReceiveUserToken !="undefined")onReceiveUserToken(resp.access_token);
				},
				error:function(err){},
				beforeSend:function(){command("showProgress");},
		        complete:function(xhr){command("dismissProgress");}
			});	
		});
		
	}


function getUserToken(){command("userToken");}


function tableTOJSON($table,$keys){
	var myRows = [];
	var $headers = $("th",$table);
	var $rows = $("tbody tr",$table).each(function(index) {
	  $cells = $(this).find("td");
	  var thisRow = {};
	  $cells.each(function(cellIndex) {
	    thisRow[$keys[cellIndex]||$($headers[cellIndex]).html()] = $(this).text().trim();
	  }); 
	  if(Object.keys(thisRow).length>0)
	  	myRows.push(thisRow);   
	});
	return myRows;
}


