function num_to_nepali($num){
	var nepali_numbers="०१२३४५६७८९";
	var num=""+$num;
	var $npNum="";
	for(i=0;i<num.length;i++){
		$npNum+=nepali_numbers[+num[i]]||num[i];
	}
	return $npNum;
}

